window.generateLua = async function (appid) {
    console.log('Generating Lua for AppID:', appid);

    // 1. Set the AppID in the mock input
    var input = document.getElementById('gid');
    if (input) {
        input.value = appid;
    } else {
        console.error('Error: Mock input #gid not found!');
        return null;
    }

    // 2. Clear previous results
    if (typeof lastFinalUrl !== 'undefined') {
        lastFinalUrl = null;
    }

    // 3. Call run() directly - it's an async function defined in the obfuscated code
    try {
        console.log('Calling run() function directly...');
        if (typeof run === 'function') {
            await run();
        } else {
            // Fallback: try clicking the button
            var btn = document.getElementById('go');
            if (btn) {
                console.log('Clicking #go button as fallback...');
                btn.click();
            } else {
                console.error('Error: run() function not found and #go button not found!');
                return null;
            }
        }
    } catch (e) {
        console.error('Error calling run():', e);
    }

    // 4. Poll for the result (give it a moment and then check)
    return new Promise((resolve, reject) => {
        var attempts = 0;
        var maxAttempts = 150; // 15 seconds

        var interval = setInterval(() => {
            attempts++;

            // Check success variable from app.js
            if (typeof lastFinalUrl !== 'undefined' && lastFinalUrl) {
                console.log('Success! URL generated:', lastFinalUrl);
                clearInterval(interval);
                resolve(lastFinalUrl);
                return;
            }

            // Check for error messages in the DOM
            var msg = document.getElementById('msg');
            if (msg && msg.textContent) {
                var msgText = msg.textContent.toLowerCase();
                // Check for specific error messages
                if (msgText.includes('not found') || msgText.includes('no file') || msgText.includes('error')) {
                    console.log('Error message detected:', msg.textContent);
                    clearInterval(interval);
                    reject('Error: ' + msg.textContent);
                    return;
                }
            }

            if (attempts >= maxAttempts) {
                clearInterval(interval);
                console.error('Generation timed out. lastFinalUrl:', lastFinalUrl);
                reject('Timeout: Script did not return a URL in time.');
            }
        }, 100);
    });
};
